import '../CSS/SignIn.css';
import React from 'react';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';
import { MDBInput, MDBCheckbox} from 'mdb-react-ui-kit';
import avatar from '../Asset/iphone.jpg';
import { useEffect, useRef, useState } from "react";

function SignIn(){
  const usernameRef = useRef();
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log("handle submit");
  };
  useEffect(() => {
    usernameRef.current.focus();
  }, []);
  
  return(
    <div class="background">
        <div class="outerbox">
            <div class="innerbox">
                <div class="loginbox">
                    <div class="form-container">                        
                        <div class="form-field">

                            <h1> Sign In </h1>

                            <div className="form__controls">
                              <label htmlFor="username">Username</label>
                              <input
                                ref={usernameRef}
                                type="text"
                                id="username"
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                              />
                            </div>

                            <MDBCheckbox class="checkbox" name="groupname" value="" label="Remember Me"/>
                            <p-button class="button" label="Login"></p-button>
                            {/* <div>------------------Or------------------</div>
                            <asl-google-signin-button type='standard' size='medium' width='300px'></asl-google-signin-button> */}

                        </div>

                        <figure><img class="image" src={avatar} alt="Image"/></figure> 
                        
                    </div>                    
                </div>
            </div>
        </div>
    </div>
  );
}

export default SignIn;
